import React, { Component } from 'react';

class Menu extends Component {

    render() {
        const Items = [
            {
                title: 'Acceuil',
                to: '/'
            },
            {
                title: 'Formation',
                to: '/formation'
            },
            {
                title: 'Projet Réalisé',
                to: '/projet'
            },
            {
                title: 'Expériences professionnelles',
                to: '/experience'
            },
            {
                title: 'Compétence',
                to: '/competence'
            }


        ];

        return (
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <a className="navbar-brand" href="/">CV</a>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav ml-auto">
                        {
                            Items.map((item,index) =>{
                                <li className="nav-item ">
                                    <NavLink key ={index} className="nav-link" to={item.to}>{item.title}</NavLink>
                                </li>   
                            })
                        }
                    {/* <li className="nav-item ">
                        <Link className="nav-link" to="/">Acceuil</Link>
                    </li>
                    <li className="nav-item ">
                        <NavLink className="nav-link" to="/formation">Formation</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/projet">Projet Réalisé</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/experience">Expériences professionnelles</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/competence">Compétence</NavLink>
                    </li> */}
                    </ul>
                </div>
            </nav>
        )
    }
}

export default Menu;
